export function parse(data) {
    let geneScores = data[0].data

    let genes = [];
    let raw = [];

    for (var i = 0; i < geneScores.length; i++){
        const gene = geneScores[i]
        const geneProfile = {
            name: gene.geneIdentifier.geneSymbol,
            variantScore: gene.variantScore,
            phenotypeScore: gene.phenotypeScore,
            combinedScore: gene.combinedScore,
            modeOfInheritance: gene.modeOfInheritance,
            contributingVariants: gene.contributingVariants,
        }

        const rawGene = gene

        genes.push(geneProfile)
        raw.push(rawGene)
    }

    return { genes, raw }
}
